import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Extract user profile information
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });
    await page.click('a:has-text("Your Profile")');
    await page.waitForSelector('.profile-info', { timeout: 5000 });

    const username = await page.textContent('.username');
    const fullName = await page.textContent('h2');
    const email = await page.textContent('.bio'); // Assuming email is in the bio for this example
    const totalOrders = await page.textContent('.stat-number:nth-of-type(1)');
    const totalReviews = await page.textContent('.stat-number:nth-of-type(2)');
    const sellerRating = await page.textContent('.stat-number:nth-of-type(3)');

    // Take a screenshot after navigating to the profile
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile.png'));

    return {
      success: true,
      action: "Harvested user profile information",
      extractedData: {
        username,
        fullName,
        email,
        totalOrders,
        totalReviews,
        sellerRating
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
